const ChatDisplay = ({ messages }) => {
    return (
        <div className="chat-display">
            {messages.map((msg, index) => (
                <div key={index} className={msg.userId === userId ? 'sent' : 'received'}>
                    <p>{msg.message}</p>
                    <span>{msg.time}</span>
                </div>
            ))}
        </div>
    );
};
